import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Home from './pages/Home';
import {Blogs} from "./pages/Blogs";

function App() {
  return (
    <BrowserRouter>
        <Routes>
            <Route index element={<Home />} />
            <Route path="blogs" element={<Blogs />} />
        </Routes>
    </BrowserRouter>
  );
}

export default App;
